INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 2834, 5118061, 2, 8, "フリーマーケット会場", 1, "ペコリーヌとの出会い", 0, "青空の下で謁見", 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 2835, 5118062, 2, 8, "フリーマーケット会場", 1, "マホとの出会い", 0, "未来の騎空団\nマスコット？", 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 2837, 5118063, 2, 8, "ランドソル市街地", 1, "アキノとの出会い", 0, "お嬢さまからの\n緊急依頼", 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 4108402, 5118064, 2, 8, "フリーマーケット会場", 1, "ジュンとの出会い", 0, "黄金色の悩みごと", 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 4107402, 5118065, 2, 8, "フリーマーケット会場", 1, "カオリとの出会い", 0, "白熱！　格闘大会！", 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 9000227, 5118066, 2, 8, "オーエド町", 1, "ニノンとの出会い", 1, "祭り太鼓はオーエドの華", 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 2101181, 5118067, 3, 8, "フリーマーケット会場", 1, "スズナとの出会い", 0, "人気者は遅れて\nやってくる", 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 4109402, 5118068, 3, 8, "ランドソル市街地", 1, "ナナカとの出会い", 0, "巫女・ミーツ・魔法少女", 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 4305402, 5118069, 3, 8, "フリーマーケット会場", 1, "キャル＆コッコロとの出会い", 0, "ネズ耳は二度なくなる", 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 4101402, 5118070, 3, 8, "ランドソル市街地", 1, "ユカリとの出会い", 0, "この出会いにカンパイ！", 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 4106402, 5118071, 3, 8, "ランドソル市街地", 1, "アオイとの出会い", 0, "陰陽アンサンブル", 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (40, 10118, 2836, 5118072, 3, 8, "フリーマーケット会場", 1, "シノブとの出会い", 1, "運試し十番勝負！", 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (0, 10118, 0, 5118600, 1, 0, 0, 0, "オープニング", 0, "彼女たちの新たな日常", 0, 0, 0, 20063115);
